import React from 'react'
import { AppBar, Toolbar, Typography } from '@mui/material';
import InstagramIcon from '@mui/icons-material/Instagram';

const Header = () => {
    return (
        <React.Fragment>
            <AppBar >
                <Toolbar >
                    <Typography><InstagramIcon></InstagramIcon></Typography>
                </Toolbar>
            </AppBar>
        </React.Fragment>
    )
}

export default Header
